import React, { Component } from 'react';

class ScheduleTime extends Component {

    constructor(props) {
        super(props);

        this.state = {
            schTime : '',
        }

        const {scheduleDateId, groupId} = props;

      }


    componentDidMount() {


    Axios.get(`https://kido-bookt-backend-default-rtdb.firebaseio.com/groupContents/${this.props.location.state.groupId}/scheduleDate/${this.scheduleDateId}/scheduleTime.json`)
    .then((response) => {
           console.log(response);
        this.setState({
            schTime: response.data
        })
    })
        .catch((error) => console.log(error));

    }

    render() {
        return (
            <>
             <div className="timeslotdiv">
                <input type="radio" required="" className="timeslotinput" name="schedule_time" id="timdateslot1" value="10:30" data-time="10:30 AM"/>
                <label htmlFor="timdateslot1"></label>
            </div>
            </>
        )
    }
}

export default ScheduleTime;
